      //
      // ハイライト
      //
      var highlight = function(mouse_over) {
        // グラフのハイライト
        var highlight_pi = svg.selectAll(".developer_"+id)
                      .selectAll(".circle")
                      .selectAll(".pi")
                      .data(trackers);
       
        highlight_pi.select(".prospect")
          .style("fill", function(d, i) {
            if (i != mouse_over) {
              return low_faint_color[i%low_faint_color.length];
            } else {
              return faint_color[i%faint_color.length];
            }
          });

        highlight_pi.select(".result")
          .style("fill", function(d, i) {
            if (i != mouse_over) {
              return faint_color[i%faint_color.length];
            } else {
              return base_color[i%base_color.length];
            }
          });

        // 凡例のハイライト
        for (var i=0; i<trackers.length; i++) {
          svg.selectAll(".legend")
            .selectAll(".tracker_"+i)
            .selectAll(".prospect")
            .attr("fill", function() {
              if (mouse_over == i) {
                return faint_color[i%faint_color.length];
              } else {
                return low_faint_color[i%low_faint_color.length];
              }
            });

          svg.selectAll(".legend")
            .selectAll(".tracker_"+i)
            .selectAll(".result")
            .attr("fill", function() {
              if (mouse_over == i) {
                return base_color[i%base_color.length];
              } else {
                return faint_color[i%faint_color.length];
              }
            });

          svg.selectAll(".legend")
            .selectAll(".tracker_"+i)
            .select(".label")
            .attr("fill", function() {
              if (mouse_over == i) {
                return "#777777";
              } else {
                return "#aaaaaa";
              }
            });
        }
      };

